// Función para crear objetos y agregarlos a un arreglo
function crearPersonas(nombres, telefonos, correos) {
  const personas = [];
  for (let i = 0; i < nombres.length; i++) {
    const persona = {
      nombre: nombres[i],
      telefono: telefonos[i],
      correo: correos[i]
    };
    personas.push(persona);
  }
  return personas;
}

